the option below.'=>'Video iki kegedhèn dienggo dadi video sesirahan. Cobānganggo video sing cendhek utāwā optimasi setelan kompressi lan unggahaké manéh berkasé ora kenā luwih sākā 8MB. Utāwā, unggahalé video Sampéyan marang YouTube lan sautaké pranālāné nang kéné nganggo opsi ngisor iki.','Only %1$s or %2$s files may be used for header video. Please convert your video file and try again, or, upload your video to YouTube and link it with the option below.'=>'Namung berkas %1$s utāwā %2$s sing bisā dienggo nang sesirahan video. Mānggā dikonversi video sampéyan lan cobā manéh, utāwā unggahānā video Sampéyan nang YouTube lan disautaké nganggo opsi ngisor iki.','Post'=>'Pos','%1$s could not be created: %2$s'=>'%1$s ora bisā digawé: %2$s','Number of widgets found: %d'=>'Jumlah widget sing ditemokaké: %d','No widgets found.'=>'Widget ora ditemokake.','Homepage'=>'Kācā ngarep','Empty title'=>'Judhul kosong','Status is forbidden'=>'Status iki larangan','Please enter a valid YouTube URL.'=>'Mānggā nglebokaké URL YouTube sing valid.','+ %s'=>'+ %s','Header Media'=>'Header Media','View User'=>'Tampilaké Panganggo','Your theme has 1 other widget area, but this particular page doesn&#8217;t display it.'=>'Tema Sampéyan nduwéni 1 area widget liyané, nanging sapérangan kācā ora nampilaké.','Your theme has %s other widget area, but this particular page doesn&#8217;t display it.'=>'Tema Sampéyan nduwéni area widget liyané %s, nanging sapérangan kācā ora nampilaké.' . "\0" . 'Tema Sampéyan nduwéni area-area widget liyané %s, nanging sapérangan kācā ora nampilaké.','Your theme has 1 widget area, but this particular page doesn&#8217;t display it.'=>'Tema Sampéyan nduwéni 1 area widget, nanging sapérangan kācā ora nampilaké.','Your theme has %s widget area, but this particular page doesn&#8217;t display it.'=>'Tema Sampéyan nduwéni area widget %s, nanging sapérangan kācā ora nampilaké.' . "\0" . 'Tema Sampéyan nduwéni area-area widget %s, nanging sapérangan kācā ora nampilaké.','You can navigate to other pages on your site while using the Customizer to view and edit the widgets displayed on those pages.'=>'Sampéyan bisā navigasi marang kācā liyā nang situs nalikā nganggo Customizer kanggo nonton lan nyunting widget sing tampil nang kācā iku.','Id should start with a letter, followed only by letters, numbers, dashes, dots, colons or underscores.'=>'Id kudu diawali karo huruf, diterusaké huruf, angka, tandha hubung, titik, titik koma utāwā garis ngisor.','Id for link anchor (TinyMCE)Id'=>'Id','Date/time'=>'Tanggal/jam','Table of Contents'=>'Daftar isi','Insert/edit code sample'=>'Seseli/sunting kode conto','Insert/edit media'=>'Seseli/sunting media','Short for red in RGBR'=>'R','Short for green in RGBG'=>'G','Short for blue in RGBB'=>'B','%s item'=>'%s iji' . "\0" . '%s iji','Looking for a theme? You can search or browse the WordPress.org theme directory, install and preview themes, then activate them right here.'=>'Nggoléki tema? Sampéyan  bisā nggolèk utāwā nlusuri nang direktori WordPress.org, masang lan nontoni tema, terus ngaktifaké nang kéné.','Edit User'=>'Sunting Panganggo','The previous set of changes has already been published. Please try saving your current set of changes again.'=>'Owahan setelan sakdurungé uwis dipacak. Māngga nyoba nyimpen setelan iki kanggo ngganténi manéh.','You must supply a future date to schedule.'=>'Sampéyan kudu nemtokaké tanggal kanggo jadwalé.','Unable to save due to %s invalid setting.'=>'Kuduné ora bisā nyimpen nang setélan %s sing keliru.' . "\0" . 'Kuduné ora bisā nyimpen nang setélan-setelan %s sing keliru.','There was an authentication problem. Please reload and try again.'=>'Ānā masalah karo proses tetepangan. Mānggā diamot ulang lan dicoba manèh.','No changes saved yet, so there is nothing to trash.'=>'Durung ānā owahan disimpen, dadi ora ānā sing dibuwang kranjang sampah.','Unable to trash changes.'=>'Ora bisa ngowahi kranjang runtah.','Changes have already been trashed.'=>'Owahan uwis dibuwang nang kranjang sampah.','Changes trashed successfully.'=>'Owah-owahan uwis kasil dibuwang kranjang runtah.','Share Preview Link'=>'Mbagi Pranālā Pratinjau','See how changes would look live on your website, and share the preview with people who can\'t access the Customizer.'=>'Delengānā piyé owahané arep kétok langsung nang situs web, lan bagi-bagi pratinjau karo wong sing ora bisa ngaksès Customizer.','Preview Link'=>'Pranālā Pratinjau','Copied'=>'Disalin','Installed themes'=>'Tema-tema sing dipasang','WordPress.org themes'=>'Tema WordPress.org','Site Icons are what you see in browser tabs, bookmark bars, and within the WordPress mobile apps. Upload one here!'=>'Ikon situs yaiku āpā sing Sampéyan deleng nang tab peramban, bilah bookmark, lan app mobile WordPress. Unggahānā siji nang kéné!','Site Icons should be square and at least %s pixels.'=>'Ikon kudu persegi lan ora luwih sākā %s piksel.','Homepage Settings'=>'Setèlan Kācā ngarep','Your homepage displays'=>'Tampilan Kācā ngarep Sampéyan','Add your own CSS code here to customize the appearance and layout of your site.'=>'Tambahaké kode CSS Sampéyan nang kéné kanggo ngracik penampilan lan tata letak situs Sampéyan.','When using a keyboard to navigate:'=>'Nalikā nganggo kibor kanggo navigasi:','In the editing area, the Tab key enters a tab character.'=>'Nang area suntingan, tombol Tab bakal ngetikaké karakter tab.','You can choose what&#8217;s displayed on the homepage of your site. It can be posts in reverse chronological order (classic blog), or a fixed/static page. To set a static homepage, you first need to create two Pages. One will become the homepage, and the other will be where your posts are displayed.'=>'Sampéyan bisā milih apa waé sing ditontonaké neng kācā ngarep situs sampéyan. Kuwi bisā kiriman kanthi urutan dipacak (klasik blog), utāwā kācā tetep/statis. Kanggo nyetèl kācā statis neng ngarepan, sampéyan kudu gawé rong Kācā. Siji bakal dadi kācā ngarep, lan liyané bakal dadi panggonan kanggo tulisan sampéyan dikatonaké.','To move away from this area, press the Esc key followed by the Tab key.'=>'Kanggo mindhahaké sākā area iki, pencèt tombol Esc dilanjutaké mencèt tombol Tab.','Screen reader users: when in forms mode, you may need to press the escape key twice.'=>'Layar wacan panganggo: yèn nang mode formulir, Sampéyan bisā mencét tombol Escape ping pindho.','The edit field automatically highlights code syntax. You can disable this in your <a href="%1$s" %2$s>user profile%3$s</a> to work in plain text mode.'=>'Suntingan ros otomatis nyoroti kode sintak. Sampéyan bisa maténi iki nang <a href="%1$s" %2$s>profil panganggo%3$s</a> kanggo kerjā nang moda teks biasa.','CSS code'=>'Kode CSS','Your theme can display menus in one location.'=>'Tema Sampéyan namung bisā nampilaké menu nang siji panggonan.','Your theme can display menus in %s location.'=>'Tema Sampéyan bisā nampilaké menu nang panggonan %s.' . "\0" . 'Tema Sampéyan bisā nampilaké menu nang panggonan-panggonan %s.','If your theme has multiple menus, giving them clear names will help you manage them.'=>'Yèn tema Sampéyan nduwéni multi menu, wénéhanā jeneng sing terang kanggo mbiyantu nataniné.','If your theme has widget areas, you can also add menus there. Visit the <a href="%s">Widgets panel</a> and add a &#8220;Navigation Menu widget&#8221; to display a menu in a sidebar or footer.'=>'Yèn tema Sampéyan nduwéni area widget, Sampéyan ugā bisā nambah menu nang kono. Tiliki <a href="%s">Widgets panel</a> lan tambah &#8220;widget Menu Navigasi&#8221; kanggo nampilaké menu nang sidebar utāwā footer.','New Menu'=>'Menu Anyar','Create New Menu'=>'Gawé Menu Anyar','Name for the Visual editor tabVisual'=>'Visual','Your theme can display menus in one location. Select which menu you would like to use.'=>'Tema Sampéyan bisā nampilaké menu nang siji panggonan. Pilih menu endi sing péngin sampéyan enggo.','menu locationsView Location'=>'Nonton Lokasi','While previewing a new theme, you can continue to tailor things like widgets and menus, and explore theme-specific options.'=>'Nalikā nontoni tema anyar, Sampéyan bisa terus ngracik āpā anané kāyā widget lan menu, lan nlusuri opsi-opsi tema sing khusus.','menu locationsView All Locations'=>'Nonton Kabèh Panggonan','It doesn&#8217;t look like your site has any menus yet. Want to build one? Click the button to start.'=>'Kétoké situs Sampéyan durung nduwéni menu. Péngin gawé? Klik nang tombol kanggo miwiti.','You&#8217;ll create a menu, assign it a location, and add menu items like links to pages and categories. If your theme has multiple menu areas, you might need to create more than one.'=>'Sampéyan arep gawé menu, wénéhānā panggonané, lan tambaānā item menu kāyā pranālā lan kācā. Yèn tema Sampéyan nduwé multi area, Sampéyan oléh gawé luwih sākā siji.','Changeset is being edited by other user.'=>'Changeset lagi disunting nang panganggo liyané.','Security check failed.'=>'Gagal mriksā keamanan.','No changeset found to take over'=>'Ora ānā changeset ditemokaké kanggo diambil alih','Sorry, you are not allowed to take over.'=>'Pangapurané, Sampéyan ora olèh mindhah tanganaké.','%s is already customizing this site. Do you want to take over?'=>'%s uwis siap natani situs iki. Sampéyan kepéngin ngambil alih?','%s is already customizing this site. Please wait until they are done to try customizing. Your latest changes have been autosaved.'=>'%s uwis siap natani situs iki. Mānggā nunggu nganti kabéh rampung ditatani. Owahan pungkasan Sampéyan uwis disimpen otomatis.','Go back'=>'Mbalik','Take over'=>'Ambil alih','Could not open handle for %1$s to %2$s.'=>'Ora bisā mbukā hèndel  %1$s to %2$s.','customizer changeset action/button labelSchedule'=>'Jadwal','Click &#8220;Next&#8221; to start adding links to your new menu.'=>'Klik &#8220;Lanjuté&#8221; kanggo miwiti nambahi pranālā marang menu anyar sampéyan.','Update anyway, even though it might break your site?'=>'Update terus, sanajan iki bisā ngrusak situs Sampéyan?','%s is already customizing this changeset. Please wait until they are done to try customizing. Your latest changes have been autosaved.'=>'%s uwis siyap natani changeset iki. Mānggā ditunggoni nganti kabéh mau rampung ditatani. Owahan pungkasan Sampéyan uwis disimpen otomatis.','%s is already customizing this changeset. Do you want to take over?'=>'%s uwis siyap natani changeset iki. Sampéyan pengin njupuk balik?','Something went wrong.'=>'Nemoni kaluputan.','You need a higher level of permission.'=>'Sampéyan mbutuhaké kawenangan sing luwih dhuwur.']];